import React, { component } from "react";
//import Axios from 'axios';

class tableau extends Component {
  constructor(props) {
    super(props);
    this.state = {
      posts: [],
    };
  }
  componentDidMount() {
    const url = "http://localhost:5000/lawyersReporter";
    fetch(url, {
      method: "GET",
    })
      .then((response) => response.json())
      .then((posts) => {
        console.log("post", posts);
      });
  }

  render() {
    return <p> Hello LAWYERS</p>;
  }
}

export default tableau;
